import styled from 'styled-components';
export const HTMLContainer = styled.div(() => {
    return {
        display: 'flex',
        marginLeft: -8,
        marginRight: -8
    };
});
export const HTMLItem = styled.div(() => {
    return {
        paddingLeft: 8,
        paddingRight: 8
    };
});
//# sourceMappingURL=Group.style.js.map
